(function() {
    var isAgreeCheckbox = document.getElementById('is-agree-checkbox');
    var submitButton = document.getElementById('submit-button');
    var iframeForLicenseAgreement = document.getElementsByClassName('license-agreement-content')[0];
    var numberOfCssFilesInIframeLeftToDownload = 0;
    var licenseAgreementIsLoaded = false;
    var DISABLED_CLASS_NAME = 'disabled';
    var TARGET_URL_REGEXP = /target_url=([^&]*)/;
    var LOAD_LICENSE_AGREEMENT_TEXT_TIMEOUT = 90000;
    var REDIRECT_TO_IC_PREFERENCE_KEY = 'taa.ic.redirect-to-ac';
    isAgreeCheckbox.checked = false;
    osa.context = wkVars.osa;
    osa.context.headers = wkVars.osaProductConfig.default.headers;
    osa.context.xdomain.enable = false;

    var userProfilePromise = osa.identity.service.profiles.many();
    var userPreferencesPromise = osa.personalitem.service.preferences.many({ $filter: "Id eq '" + REDIRECT_TO_IC_PREFERENCE_KEY + "'" });
    var targetUrl = getTargetUrl();

    isAgreeCheckbox.addEventListener('change', isAgreeHandler);
    submitButton.addEventListener('click', submitHandler);

    loadLicenseAgreementText();

    function isAgreeHandler() {
        if (isAgreeCheckbox.checked) {
            submitButton.classList.remove(DISABLED_CLASS_NAME);
            submitButton.disabled=false;
        } else {
            submitButton.classList.add(DISABLED_CLASS_NAME);
            submitButton.disabled=true;
        }
    }

    function submitHandler() {
        var preference = new osa.personalitem.Preference({
            id: wkVars.usedPreferences.common.licenseKey,
            value: wkVars.licenseAgreementValue.toString()
        });

        if (licenseAgreementIsLoaded) {
            osa.personalitem.service.preferences.add(preference)
                .then(trackAppcuesEvent)
                .then(function() {
                    changeLocation(targetUrl);
                })
                .catch(function() {
                    changeLocation('/');
                });
        }
    }

    function changeLocation(targetUrl) {
        setTimeout(function() {
            window.location.replace(targetUrl);
        }, 500); // wait until analytics tools like appcues send its events
    }

    function getTargetUrl() {
        var targetUrlMatch = window.location.search.match(TARGET_URL_REGEXP);

        return targetUrlMatch ? decodeURIComponent(targetUrlMatch[1]) : '/';
    }

    function trackAppcuesEvent() {
        if (!Appcues) {
            return;
        }

        return Promise.all([userProfilePromise, userPreferencesPromise])
            .then(function([profiles, preferences]) {
                var profile = profiles[0];
                var redirectFromICPreference = preferences[0];
                var payload = {
                    account: profile.user.account,
                    accountNumber: profile.accountNumber,
                    email: profile.userEmail,
                    firstName: profile.userFirstName,
                    lastName: profile.userLastName,
                    id: profile.id,
                    language: profile.language
                }
                payload[REDIRECT_TO_IC_PREFERENCE_KEY] = !!redirectFromICPreference && redirectFromICPreference.value === 'true';
                Appcues.identify(profile.id, payload);
                Appcues.track('acceptedLicenseAgreement', payload);
            });
    }

    function onLicenseAgreementTextLoad(event) {
        var responseStatus = event.currentTarget.status;
        var textOfLicenseAgreement = event.currentTarget.responseText;
        var cssLinks = [];
        var base = null;

        if (responseStatus === 200) {
            iframeForLicenseAgreement.contentWindow.document.body.style.display = 'none';
            iframeForLicenseAgreement.contentDocument.body.innerHTML = textOfLicenseAgreement;

            //fix for relative links in text of license agreement (Firefox)
            base = iframeForLicenseAgreement.contentWindow.document.querySelector('base');
            if (base) {
                base.setAttribute('href', location.origin);
            }

            makeAllLinksInIframeToOpenInNewTab();

            //we have to use two selectors for css links, because currently the 'rel' attribute contains
            //uppercase letters
            cssLinks = iframeForLicenseAgreement.contentWindow.document
                .querySelectorAll('link[rel="stylesheet"], link[rel="StyleSheet"]');

            convertAllRelativeStaticCssLinksToAbsolute(cssLinks);

            for (var i = 0; i < cssLinks.length; ++i) {
                ++numberOfCssFilesInIframeLeftToDownload;
                cssLinks[i].addEventListener('load', onLicenseAgreementCssFileLoad);

                cssLinks[i].addEventListener('error', function() {
                    onLicenseAgreementCssFileLoad();
                });
            }
        }
    }

    //fix for firefox (firefox can't load css files using relative path
    //because of the security settings)
    function convertAllRelativeStaticCssLinksToAbsolute(cssLinks) {
        for (var i = 0; i < cssLinks.length; ++i) {
            var href = cssLinks[i].getAttribute('href');

            if (href && href.indexOf('/static/') === 0) {
                cssLinks[i].setAttribute('href', location.origin + href);
            }
        }
    }

    function makeAllLinksInIframeToOpenInNewTab() {
        var htmlLinks = iframeForLicenseAgreement.contentWindow.document.querySelectorAll('a');

        for (var i = 0; i < htmlLinks.length; ++i) {
            var href = htmlLinks[i].getAttribute('href');

            if (href) {
                htmlLinks[i].setAttribute('target', '_blank');
            }
        }
    }

    function onLicenseAgreementCssFileLoad() {
        --numberOfCssFilesInIframeLeftToDownload;
        //this check is required in order to avoid flash of unstyled content
        if (numberOfCssFilesInIframeLeftToDownload === 0) {
            hideLoadingSpinner();
            iframeForLicenseAgreement.contentWindow.document.body.style.display = 'block';
            licenseAgreementIsLoaded = true;
            isAgreeCheckbox.disabled = false;
        }
    }

    function hideLoadingSpinner () {
        var loadingSpinnerContainerElement = document.getElementsByClassName('loading-spinner-container')[0];

        loadingSpinnerContainerElement.style.display = 'none';
    }

    function loadLicenseAgreementText() {
        var xhr = new XMLHttpRequest();
        var licenseAgreementTextUrl = location.origin + wkVars.latestVersionOfLicenseAgreementTextUrl;

        xhr.open('GET', licenseAgreementTextUrl, true);
        xhr.timeout = LOAD_LICENSE_AGREEMENT_TEXT_TIMEOUT;
        xhr.addEventListener('load', onLicenseAgreementTextLoad);
        xhr.send();
    }
})();
